                                                        <Form.Item
                                                            {...restField}
                                                            name={[name, 'specific_gravity']}
                                                            fieldKey={[fieldKey, 'Specific_gravity']}
                                                            rules={[{ required: true, message: 'Specific gravity' }]}
                                                            label="Specific gravity"
                                                            labelCol={{span: 9, offset: 0}}
                                                            labelAlign="left"
                                                        >
                                                            <Input className="w-full"/>
                                                        </Form.Item>
                                                    </Col>
                                                    <Col span={7}>
                                                        <Form.Item
                                                            {...restField}
                                                            name={[name, 'bulk_density']}
                                                            fieldKey={[fieldKey, 'bulk_density']}
                                                            rules={[{ required: true, message: 'Bulk density' }]}
                                                            label="Bulk density"
                                                            labelCol={{span: 9, offset: 0}}
                                                            labelAlign="left"
                                                        >
                                                            <Input className="w-full"/>
                                                        </Form.Item>
                                                    </Col>
                                                    <Col span={2}>
                                                        <MinusCircleOutlined onClick={() => remove(name)} />
                                                    </Col>
                                                </Row>
                                            ))}
                                            <Row gutter={24}>
                                                <Col span={8}>
                                                    <Form.Item>
                                                        <Button
                                                            type="dashed"
                                                            onClick={() => add()}
                                                            block
                                                            icon={<PlusOutlined />}
                                                        >
                                                            Add proppant
                                                        </Button>
                                                    </Form.Item>
                                                </Col>
                                            </Row>

                                        </>
                                    )}
                                </Form.List>
                            </Form>
                        </Card>
                    </Panel>
                    <Panel header={<strong>Active Data</strong>} >
                        <Card>
                            <Form
                                name="active_data_form"
                                onValuesChange={activeDataFormChange}
                                autoComplete="off"
                                initialValues={activeDataFormValues}
                            >
                                <Divider orientation="left" plain><strong>Pilsing parameters</strong></Divider>
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'wave_type'}
                                            label="Wave type"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'periods'}
                                            label="Periods"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'frequency'}
                                            label="Freq [Hz]"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'offset'}
                                            label="Offset [V]"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={10}>
                                        <Form.Item
                                            name={'amplitude'}
                                            label="Amplitude"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={10}></Col>
                                </Row>
                                <Divider orientation="left" plain><strong>Pre-frac pulses</strong></Divider>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'pre_start_time'}
                                            label="Start time"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'pre_end_time'}
                                            label="End time"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'pre_number_of_pulses'}
                                            label="# of pulses"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Divider orientation="left" plain><strong>Post-frac pulses</strong></Divider>
                                <Row gutter={24}>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'post_start_time'}
                                            label="Start time"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'post_end_time'}
                                            label="End time"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                    <Col span={8}>
                                        <Form.Item
                                            name={'post_number_of_pulses'}
                                            label="# of pulses"
                                            labelCol={{span: 9, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <Input className="w-full"/>
                                        </Form.Item>
                                    </Col>
                                </Row>
                            </Form>
                        </Card>
                    </Panel>
                    <Panel header={<strong>Notes</strong>} >
                    <Card>
                            <Form
                                name="notes_data_form"
                                onValuesChange={notesFataFormChange}
                                autoComplete="off"
                                initialValues={notesFataFormValues}
                            >

                                <Row gutter={24}>
                                    <Col span={20}>
                                        <Form.Item
                                            name={'pre_notes'}
                                            label="Pre-frac pulse notes"
                                            labelCol={{span: 5, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <TextArea rows={4} />
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={20}>
                                        <Form.Item
                                            name={'post_notes'}
                                            label="Post-frac pulse notes"
                                            labelCol={{span: 5, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <TextArea rows={4} />
                                        </Form.Item>
                                    </Col>
                                </Row>
                                <Row gutter={24}>
                                    <Col span={20}>
                                        <Form.Item
                                            name={'other_notes'}
                                            label="Other notes"
                                            labelCol={{span: 5, offset: 0}}
                                            labelAlign="left"
                                        >
                                            <TextArea rows={4} />
                                        </Form.Item>
                                    </Col>
                                </Row>
                            </Form>
                        </Card>
                    </Panel>
                </Collapse>
                <div className="mt-4 w-full text-right">
                    <span className="mr-4">Last submitted date: 08/07/2021</span>
                    <Button type="primary" onClick={(e) => handleTrackingSheetSubmit()}>Submit tracking sheet</Button>
                </div>
            </Card>
            {
                showConfirmationModal && 
                <ConfirmationModal
                    isModalVisible={showConfirmationModal}
                    handleCancel={handleCancel}
                    handleOk={handleAddStageConfirmed}
                    modalTitle={"Add stage"}
                    modalText={"Are you sure you want to another stage ?"}
                    footerButtons={{cancel_text: 'Cancel', confirm_text: 'Yes'}}
                    data={modalData}
                >
                </ConfirmationModal>
            }
        </>
    );
}
